import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header";
import Nav from "./Nav";
import "./index.css";
import ToSecData from "./TwoSecData";
import TwoSec from "./TwoSec";
import TextSec from "./TextSec";

function Two(value){
    return(
         <TwoSec imgSrc={value.imgSrc}
             h6={value.h6}
             h2={value.h2}
             para={value.para}
         />
    )
}

ReactDOM.render(
     <>
         <Nav/>
         <Header/>
         <div className="two-section">
                 {ToSecData.map(Two)}
         </div>
         <div className="text-sec">
              <TextSec/>
         </div>
         <div className="img-text-sec">
         <TextSec/>
         </div>

         <div className></div>
     </>,document.getElementById("root")
);
